import React from 'react';

const HealthInsurance = () => {
  const plans = [
    {
      name: 'Basic Plan',
      details: 'Covers basic health needs.',
      pdf: 'https://www.learningcontainer.com/wp-content/uploads/2019/09/sample-pdf-file.pdf',
      image: 'https://picsum.photos/400/300?random=1',
    },
    {
      name: 'Premium Plan 1 ',
      details: 'Comprehensive coverage.',
      pdf: 'https://www.learningcontainer.com/wp-content/uploads/2019/09/sample-pdf-file.pdf',
      image: 'https://picsum.photos/400/300?random=2',
    },  
	{
      name: 'Premium Plan 2',
      details: 'Comprehensive coverage.',
      pdf: 'https://www.learningcontainer.com/wp-content/uploads/2019/09/sample-pdf-file.pdf',
      image: 'https://picsum.photos/400/300?random=2',
    },    
	{
      name: 'Premium Plan 3',
      details: 'Comprehensive coverage.',
      pdf: 'https://www.learningcontainer.com/wp-content/uploads/2019/09/sample-pdf-file.pdf',
      image: 'https://picsum.photos/400/300?random=2',
    },
  ];

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl md:text-4xl font-bold text-blue-600 mb-8">Health Insurance Plans</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {plans.map((plan, index) => (
          <div key={index} className="bg-white rounded-lg shadow-md overflow-hidden">
            <img
              src={plan.image}
              alt={plan.name}
              className="w-full h-48 object-cover"
            />
            <div className="p-6">
              <h2 className="text-2xl font-semibold text-blue-600 mb-2">{plan.name}</h2>
              <p className="text-gray-700 mb-4">{plan.details}</p>
              <a
                href={plan.pdf}
                target="_blank"
                rel="noopener noreferrer"
                className="inline-block bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
              >
                Download PDF
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default HealthInsurance;
